import React, { useState } from 'react';

const App = () => {
  const [showDetails, setShowDetails] = useState(false);
  const [mandateDetails, setMandateDetails] = useState([]);
  const [error, setError] = useState(null);

  const handleButtonClick = async () => {
    try {
      const response = await fetch('http://localhost:3010/${endpoints}');
      if (!response.ok) {
        throw new Error('Failed to fetch data');
      }
      const data = await response.json();
      console.log('Fetched data:', data);

      const details = Array.isArray(data) ? data.map(item => ({
        traderMandateId: item.traderMandateId,
        traderName: item.traderName
      })) : [{
        traderMandateId: data.traderMandateId,
        traderName: data.traderName
      }];

      setShowDetails(true);
      setMandateDetails(details);
      setError(null); // Clear any previous errors
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Failed to fetch data. Please try again.'); // Set error state
    }
  };

  return (
    <div>
      <button onClick={handleButtonClick} disabled={showDetails}>
        {showDetails ? 'Details Fetched' : 'Fetch Endpoint Details'}
      </button>
      {error && <p>{error}</p>}
      {showDetails && (
        <div>
          {mandateDetails.map((detail, index) => (
            <div key={index}>
              <h2>Endpoint Details {index + 1}</h2>
              <p>traderMandateId: {detail.traderMandateId}</p>
              <p>traderName: {detail.traderName}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default App;
